import React from "react";

function Profile(props) {

return (
    <div>
    {props.info.map((el) => (
        <h1>Name : {el.name}</h1>
    ))}
    {props.info.map((el) => (
        <h1>Name : {el.bio}</h1>
    ))}
    {props.info.map((el) => (
        <h1>Name : {el.name}</h1>
    ))}
    </div>
);
}

export default Profile;
